import { useState, useEffect } from "react";
import api from "../utils/api.js";
import { Link } from "react-router-dom";

function Profile() {
  const [user, setUser] = useState(null);
  const token = localStorage.getItem("token");

  useEffect(() => {
    const fetchProfile = async () => {
      try {
        const res = await api.get("/users/profile", {
          headers: { Authorization: `Bearer ${token} ` }
        });
        setUser(res.data);
      } catch (error) {
        console.error("Error fetching profile", error);
      }
    };
    fetchProfile();
  }, [token]);

  if (!user) return <p>Loading profile...</p>;

  return (
    <>
       <div className="flex justify-center items-center mt-10 mb-10">
      <div className="w-full max-w-2xl bg-white shadow-lg rounded-xl p-8">
        {/* Title */}
        <h2 className="text-2xl font-bold text-center flex items-center justify-center gap-2 text-indigo-700">
          <i className="fa-solid fa-user"></i> Profile Details
        </h2>
        <hr className="my-4" />

        {/* Info */}
        <p className="text-lg"><b>Name:</b> {user.name}</p>
        <p className="text-lg"><b>Age:</b> {user.age || "Not set"}</p>
        <p className="text-lg"><b>Height:</b> {user.height ? `${user.height} cm` : "Not set"}</p>
        <p className="text-lg"><b>Weight:</b> {user.weight ? `${user.weight} kg` : "Not set"}</p>
        <p className="text-lg"><b>Gender:</b> {user.gender || "Not set"}</p>

        {/* Goals Section */}
        <div className="mt-5">
          <p className="text-lg font-semibold flex items-center gap-2">
            <i className="fa-solid fa-bullseye"></i> Goals:
          </p>
          {user.goal ? (
            <ul className="list-disc ml-6 mt-2 space-y-1">
              <li><i className="fa-solid fa-droplet text-blue-500"></i> Water: {user.goal.water} glasses</li>
              <li><i className="fa-solid fa-shoe-prints text-green-600"></i> Steps: {user.goal.steps} steps</li>
              <li><i className="fa-solid fa-bed text-purple-500"></i> Sleep: {user.goal.sleep} hrs</li>
              <li><i className="fa-solid fa-fire text-orange-500"></i> Calories: {user.goal.calories} kcal</li>
            </ul>
          ) : (
            <p className="text-sm text-gray-500 mt-2">Not set</p>
          )}
        </div>

        {/* Buttons */}
        <div className="grid gap-3 mt-6">
          <Link
            to={"/profileform"}
            className="w-full text-center bg-green-600 hover:bg-green-700 text-white py-2 rounded-lg text-lg font-medium transition duration-200"
          >
            Update Profile
          </Link>

          <Link
            to={"/logout"}
            className="w-full text-center bg-red-600 hover:bg-red-700 text-white py-2 rounded-lg text-lg font-medium transition duration-200"
          >
            Logout
          </Link>
        </div>
      </div>
    </div>
    </>
  );
}

export default Profile;
